import { React, useState, useEffect } from "react";
import axios from "axios";

const Profilemini = () => {
  return (
    <>
      <div className="card w-[30rem] bg-base-100 shadow-xl">
        <form>
          <figure className="px-10 pt-10 flex-col gap-2">
            <img
              src={require("../../assets/images/christopher-campbell.jpg")}
              alt="Shoes"
              className="rounded-full w-[10rem] h-[10rem]"
            />
            <input type='input'></input>
          </figure>
          <div className="card-body ">
            <h2 className="card-title">Christopher</h2>
            <h3>Web Developer</h3>
            <div className="items-center card-actions flex-col sm:w-[18rem] lg:w-[28rem]">
              <button className="btn btn-primary  text-white hover:bg-white hover:text-secondary w-[100%]">
                Ubah Password
              </button>
              <button className="btn btn-primary  outline-secondary bg-white text-[#1E1E1E] hover:text-white w-[100%]">
                Kembali
              </button>
            </div>
          </div>
        </form>
      </div>
    </>
  );
};

export default Profilemini;
